import base64
import datetime
from database import db

from hashlib import md5, sha1


class HashTool:

    def __init__(self, default_image_path="/"):
        self.image_path = default_image_path

    '''
    1. 根据图片所在位置获取图片Base64编码，并计算生成唯一hash
    '''

    @classmethod
    def get_image_base64_hash(self, image_path):
        with open(image_path, "rb") as imageFile:
            b = imageFile.read()
            str_base64 = base64.b64encode(b)
            m5 = md5()
            m5.update(str_base64)
            return m5.hexdigest()

    @classmethod
    def get_base64_hash(self, base64_data):
        str_base64 = base64.b64encode(base64_data)
        m5 = md5()
        m5.update(str_base64)
        return m5.hexdigest()

    '''
    2. 
    '''

    @classmethod
    def get_str_hash(self, str):
        if str is None:
            return 0
        count = int(sha1(str.encode()).hexdigest(), 16) % (10 ** 18)
        print(count)
        return count


